import RegisterForm from '../../elements/widgets/Form/Register';
import { Fragment } from 'react';


export default function Test(){

    return(
        <Fragment>
            <Header/>
            <Bread breadName ="Test List" />
            <RegisterForm />
            <Footer/>
        </Fragment>
    );
}
